const styles = (theme) => ({
  actionButton: {
    marginLeft: theme.spacing(1),
  },
  searchWrapper: {
    marginTop: theme.spacing(1.5),
  },
  search: {
    maxWidth: '100%!important',
    marginBottom: theme.spacing(1),
  },
});

export default styles;
